        for (var p1 in assets) {
            if (assets.hasOwnProperty(p1))
                pic_name.push(p1);
        }
        for (var i = 0; i < pic_name.length; i++) {
            this.textures.addBase64(pic_name[i], eval("assets." + pic_name[i]))
        }

        var imageCount = pic_name.length;
        var loadedCount = 0;
        this.textures.on('addtexture', function () {
            loadedCount++;

                }
                for(var i = 0; i<box[0].length; i++){
                    box_arr[i] = this.add.image(box[0][i].x,box[0][i].y,'box').setDepth(2)
                }
                // for(var i = 0; i<box[0].length; i++){
                //     w_arr[i] = this.add.image(box[0][i].x,box[0][i].y,box[0][i].name+'1').setDepth(2).setVisible(0)
                // }
                for(var i = 0; i<box[0].length; i++){
                    w_blue_arr[i] = this.add.image(box[0][i].x,box[0][i].y,box[0][i].name+'2').setDepth(2).setVisible(0)
                }
                // for(var i = 0; i<box[0].length; i++){
                //     w_red_arr[i] = this.add.image(box[0][i].x,box[0][i].y,box[0][i].name+'3').setDepth(2).setVisible(0)
                // }
                break;
            case 4:
                for(var i = 0;i<words[1].length;i++){
                    words_arr[i] = this.add.image(words[1][i].x,words[1][i].y,words[1][i].name).setDepth(2)
                }
                for(var i = 0; i<box[1].length; i++){
                    box_arr[i] = this.add.image(box[1][i].x,box[1][i].y,'box').setDepth(2)
                }
                break;
            default:
                break;
        }



    }

    showDownload() {
        var rect = new Phaser.Geom.Rectangle(0, 0, game.config.width, game.config.height);
        var graphics1 = this.add.graphics({
            fillStyle: {
                color: 0x000000
            }
        });
        graphics1.alpha = 0.8;
        graphics1.setDepth(8);
        graphics1.fillRectShape(rect);
        var win_bg = this.add.image(256, -400, 'finish1_optimized').setDepth(10)
        var down = this.add.image(256, 520, 'continue_optimized').setDepth(10).setScale(0, 0).setInteractive().on('pointerdown', () => {
            landingPage()
        })
        this.tweens.add({
            targets: [win_bg],
            y: 400,
            duration: 800,
            ease: 'Back',
            onComplete: () => {
                this.tweens.add({
                    targets: [down],
                    scaleX: 1,
                    scaleY: 1,
                    duration: 500,
                    onComplete: () => {
                        setInterval(() => {
                            this.tweens.add({
                                targets: [down],
                                scaleX: 1.1,
                                scaleY: 1.1,
                                duration: 300,
                                onComplete: () => {
                                    this.tweens.add({
                                        targets: [down],
                                        scaleX: 1,
                                        scaleY: 1,
                                        duration: 300,
                                        onComplete: () => {

                                        }
                                    })
                                }
                            })
                        }, 600);

                    }
                })
            }
        })
    }



    resize() {
        var canvas = document.querySelector("canvas");
        var windowWidth = window.innerWidth;
        var windowHeight = window.innerHeight;
        var windowRatio = windowWidth / windowHeight;
        var gameRatio = game.config.width / game.config.height;
        if (windowRatio < gameRatio) {
            canvas.style.width = windowWidth + "px";
            canvas.style.height = (windowWidth / gameRatio) + "px";
        } else {
            canvas.style.width = (windowHeight * gameRatio) + "px";
            canvas.style.height = windowHeight + "px";
        }
    }
